import React from 'react';
import hero from '../../images/contact-hero.jpg'

export default function ContactHero(props) {
    return (
        <div style={{backgroundImage: `url(${hero})`}} className='contact-page__hero' alt='Kontakt side hero bilde; hytte med utsikt, kveld/natt' >

        </div>
    )
}
